import React, { Component } from 'react';
import Intro from '../Intro'
import './App.css';


class App extends Component {

	constructor(){
		super();

		this.state = {
			list: []
		}
	}

	componentDidMount(){
		fetch('http://makeup-api.herokuapp.com/api/v1/products.json?brand=maybelline')
		.then(response => response.json())
		.then(json => console.log(json))
	}

	render() {
		return (
		   <div className="App">
		      <header className="App-header">
		        <h1 className="App-title">Beauty List</h1>
		      </header>
		      <Intro message="Here you will find most favourite Beauty List"/>
		      The length of List array: {this.state.list.length}
			</div>
		)
	}
}
export default App;
